class BSTIterator:
    def __init__(self, root):
        self.stack = []
        self.push_left(root)

    def next(self):
        temp = self.stack.pop()
        self.push_left(temp.right)
        return temp.val

    def has_next(self):
        return bool(self.stack)

    def push_left(self, root):
        while root:
            self.stack.append(root)
            root = root.left
